import data from "./data";

import Load from "./load";

function App() {
  console.log(data);
  return (
    <div>
      <Load data={data} />
      {data.map((cData) => {
        cData.isFolder ? (
          <Load folder={cData} />
        ) : (
          <div>
            cData.name
            <br />
          </div>
        );
      })}
    </div>
  );
}

export default App;
